import React from "react";
import { withStyles } from "@material-ui/core/styles";

const styles = {
  title: {
    color: "#E040FB",
    fontFamily: "Quicksand",
    fontWeight: "bold",
    fontSize: "1.5em"
  },
  picture: {
    maxWidth: "100%",
    height: "100vh",
    margin: "auto"
  },
  text: {
    color: "#30323e",
    fontFamily: "Quicksand",
    fontWeight: "bold",
    fontSize: "2.5vmax",
    backgroundColor: "rgba(216, 220, 242, 0.6)",
    padding: "1em",
    marginBottom: "5em",
    borderRadius: 20
  },
  all: {
    backgroundColor: "#212127d3",
    borderRadius: 30,
    margin: "1em",
    marginBottom: 50
  }
};

function IvlList(props) {
  const { classes } = props;
  return (
    <div className={classes.all}>
      <h1 className={classes.title}>{props.title}</h1>
      <div className={classes.grid}>
        <img className={classes.picture} src={props.photo} alt="" />
        <h3 className={classes.text}>{props.description}</h3>
      </div>
    </div>
  );
}

export default withStyles(styles)(IvlList);
